import {
  useCreate{moduleName},
  useUpdate{moduleName},
} from "@/services/management/{moduleName.toLowerCase()}/{moduleName.toLowerCase()}.hook";
import {
  useCreateAdmin,
  useUpdateAdminNew,
} from "@/services/master/admin/admin.hook";

export interface CreateEdit{moduleName}Props {
  editMode?: boolean;
}

type {moduleName}Data = {
  id: number;
  {moduleName.toLowerCase()}_name: string;
  address: string;
  city: {
    id: number;
    city_name: string;
  };
  city_id: number;
  state: {
    id: number;
    state_name: string;
  };
  state_id: number;
  registration_number: string;
  created_at: string;
  updated_at: string;
};

export type {moduleName}ApiResponse = {
  currentPage: number;
  list: {moduleName}Data[];
  totalCount: number;
  totalPages: number;
};

export interface {moduleName}Payload {
  {moduleName.toLowerCase()}_name: string;
  address: string;
  city_id: number;
  state_id: number;
  registration_number: string;
}

export type MutationApi =
  | ReturnType<typeof useCreate{moduleName}>
  | ReturnType<typeof useUpdate{moduleName}>
  | ReturnType<typeof useCreateAdmin>
  | ReturnType<typeof useUpdateAdminNew>;
